import React from 'react'

const menu = [
    {
        text: 'Studio'
    },
    {
        text: 'Partners'
    },
    {
        text: 'Media'
    },
    {
        text: 'user'
    }
]

export const Menu = () => {
    return (
            menu.map((item, index) => (
                    <li>
                        <p>{menu.text}</p>
                    </li>
                )
            )
    )
}

export default Menu;
